import React, { Component } from "react";
import { Animated } from "react-animated-css";

class Profile extends Component {
  render() {
    return (
      <section class="custom-profile">
        <div class="jumbotron jumbotron-fluid">
          <div class="container">
          </div>
        </div>
      </section>
    );
  }
}
export default Profile;
